/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `users` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `created_user` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '创建人',
  `updated_user` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '修改人',
  `version` int(11) DEFAULT NULL COMMENT '冗余字段',
  `identity` int(11) DEFAULT NULL COMMENT '用户身份 0普通注册用户 1VIP会员 2区代 3市代 4省代',
  `login_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '登录名',
  `password` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '密码',
  `name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '用户名称',
  `avatar_id` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '头像id',
  `phone_country` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '手机号码地区',
  `phone` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '手机号',
  `cash_money` decimal(20,2) DEFAULT NULL COMMENT '账户现金币，参与分销',
  `int_egral_money` int(11) DEFAULT NULL COMMENT '购物券，不参与分销',
  `share_money` decimal(20,2) DEFAULT NULL COMMENT '分销累计收益，只计算',
  `point_money` decimal(20,2) DEFAULT NULL COMMENT '个人积分',
  `one_higher` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '一级直系上级',
  `two_higher` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '二级直系上级',
  `three_higher` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '三级直系上级',
  `relation_tree` longtext COLLATE utf8mb4_unicode_ci COMMENT '关系树，从上级继承',
  `reg_vip_time` timestamp NULL DEFAULT NULL COMMENT '升级vip时间',
  `pay_password` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '支付密码',
  `recommend_code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '推荐码，生成规则：就是登录名',
  `reg_path` int(11) DEFAULT NULL COMMENT '录入系统方式， 0自己注册 1后台导入 2后台添加 3代注册',
  `full_rebate_count` int(11) DEFAULT NULL COMMENT '为代理时，享受全部返利的剩余个数',
  `user_ebate_count` int(11) DEFAULT NULL COMMENT '消耗的全部返利数量',
  `bank_code` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行代码',
  `bank_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行名',
  `bank_card_people` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '持卡人',
  `bank_card_num` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '银行卡号',
  `nocode` int(11) DEFAULT NULL COMMENT '特殊标识[1特殊人群]。不用发货,只针对礼包和复购',
  `qrcode` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `activity_code` int(11) DEFAULT '0' COMMENT ' 是否已参加活动 1已参加',
  `vip_level` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'VIP礼包等级',
  `real_name` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '真实姓名',
  `id_card` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '身份证',
  `up_str` varchar(255) COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT '升级标签',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态 0 禁用 1开启',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=26767 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

